@Rajat Saklani you feel the need to be recognized for posting the first comment.... enough said.  That obviously is one of your life goals.  

I've met most of mine.  They were more complicated than being first in a comment on youtube however.  

Get a life honey.  Put the phone down occasionally. Interact with real people,  face to face.  Just saying.

